import{_ as o,p as a,q as d,a1 as p}from"./framework-d34b771a.js";const c={};function r(i,e){return a(),d("div",null,e[0]||(e[0]=[p('<h1 id="плагины-и-команды-сервера" tabindex="-1"><a class="header-anchor" href="#плагины-и-команды-сервера" aria-hidden="true">#</a> Плагины и команды сервера</h1><h2 id="формат-чата" tabindex="-1"><a class="header-anchor" href="#формат-чата" aria-hidden="true">#</a> Формат чата</h2><p>На сервере используеться плагин InteractiveChat Вы можете показать игрокам свой предмет/инвентарь/cундук/уровень/и т.д Так же это все дублируеться в дискорд чат сервера</p><p>Пиши в чат [Название] Примеры:</p><ol><li>&quot;[item]&quot; - Покажите предмет, который вы держите, в чате!</li><li>&quot;[inv]&quot; - Покажи свой инвентарь в чате!</li><li>&quot;[ender]&quot; - Покажи свой Cундук Эндера в чате!</li><li>&quot;[money]&quot; - Покажите количество денег, которое у вас есть в чате!</li><li>&quot;[gametime]&quot; - Показывает текущее время мира, в котором вы находитесь!</li><li>&quot;[time]&quot; - Показывает текущее время сервера в реальном мире!</li><li>&quot;[pos]&quot; - Показывает ваше текущее положение!</li><li>&quot;[ping]&quot; - Показывает ваш текущий пинг!</li></ol><h2 id="общие-команды" tabindex="-1"><a class="header-anchor" href="#общие-команды" aria-hidden="true">#</a> Общие команды</h2><h3 id="регистрация-авторизация" tabindex="-1"><a class="header-anchor" href="#регистрация-авторизация" aria-hidden="true">#</a> Регистрация/Авторизация</h3><p>/register (pass) (pass) или /reg (pass) (pass) : Эта команда для регистрации аккаунта</p><p>/login (pass) или /l (pass) : Эта команда для входа в Ваш аккаунт</p><p>/changepassword (oldpass) (newpass): Эта команда для изменения пароля</p><p>/unregister : Эта команда для удаления Вашего аккаунта</p><p>/destroysession - Destroy Account Auth Session Command</p><p>/license or /premium - Command Makes Account Premium</p><p>(pass) - Ваш пароль</p><p>(newpass) - Ваш новый пароль</p><p>(oldpass) - Ваш старый пароль</p><h3 id="игровая-валюта" tabindex="-1"><a class="header-anchor" href="#игровая-валюта" aria-hidden="true">#</a> Игровая Валюта</h3><p>/money (player) : Эта команда показывает вашу валюту или другого игрока</p><p>/money top (page) : Эта команда показывает самых богатых игроков</p><p>/money pay (player) (amount) : Этой командой вы отправляете свои деньги другому.</p><p>(player) - Игрок</p><p>(page) - Номер страницы</p><p>(amount) - Сумма перевода</p><h2 id="lobby-сервер" tabindex="-1"><a class="header-anchor" href="#lobby-сервер" aria-hidden="true">#</a> Lobby сервер</h2><h2 id="recreation-сервер" tabindex="-1"><a class="header-anchor" href="#recreation-сервер" aria-hidden="true">#</a> Recreation сервер</h2><h3 id="список-плагинов-на-сервере" tabindex="-1"><a class="header-anchor" href="#список-плагинов-на-сервере" aria-hidden="true">#</a> Список плагинов на сервере</h3><p><code>AdvancedBan</code> - Это универсальная система наказаний с предупреждениями, временными предупреждениями, отключением звука, временным отключением звука, банами, временными банами, ip-банами, временными банами и киками.</p><p><code>AzLink</code> - Это подключаемый модуль, созданный для Azuriom, который позволяет связать ваш сервер с веб-сайтом Azuriom простым, быстрым и безопасным способом.</p><p><code>BanItem</code> - Это простой, мощный, легкий и настраиваемый для каждого мира плагин для запрета действий. Основная цель плагина - отключить определенные действия для определенных элементов в конкретных мирах , поддерживая определенные разрешения .</p><p><code>Chunky</code> - Предварительно генерирует фрагменты быстро, эффективно и безопасно.</p><p><code>ChunkyBorder</code> - Надстройка для Chunky , позволяющая создавать границы мира и управлять ими</p><p><code>CoreProtect</code> - Это быстрый и эффективный инструмент для регистрации данных и защиты от грифинга. Откат и восстановление любого количества повреждений</p><p><code>DiscordSRV</code></p><p><code>EasyWhitelist</code></p><p><code>Essentials</code></p><p><code>EssentialsChat</code></p><p><code>EssentialsProtect</code></p><p><code>EssentialsSpawn</code></p><p><code>Harbor</code></p><p><code>ImageOnMap</code></p><p><code>LiteEco</code></p><p><code>LuckPerms</code></p><p><code>Multiverse-Core</code></p><p><code>Multiverse-NetherPortals</code></p><p><code>Mu1tiverse-Portals</code></p><p><code>NBTAPI</code></p><p><code>OpenInv</code></p><p><code>PlaceholderAPI</code></p><p><code>Plan</code></p><p><code>PlasmoVoice</code></p><p><code>ProtocolLib</code></p><p><code>Quests</code></p><p><code>QuickShop</code></p><p><code>SkinsRestorer</code></p><p><code>spark</code></p><p><code>Tablist</code></p><p><code>Towny</code></p><p><code>TreeAssist</code></p><p><code>Vault</code></p><p><code>VentureChat</code></p><p><code>ViaBackwards</code></p><p><code>ViaVersion</code></p><p><code>WorldsColor</code></p><h3 id="команды-на-сервере" tabindex="-1"><a class="header-anchor" href="#команды-на-сервере" aria-hidden="true">#</a> Команды на сервере</h3><h2 id="skyblock-сервер" tabindex="-1"><a class="header-anchor" href="#skyblock-сервер" aria-hidden="true">#</a> SkyBlock сервер</h2>',65)]))}const t=o(c,[["render",r],["__file","index.html.vue"]]);export{t as default};
